export default class Status extends Component {
  show() {
    return <status>page 6</status>
  }

  styles = {
    status: {
      position: "fixed",
      flexFlow: "row",
      left: 0,
      bottom: 0,
      right: 0,
      height: 30,
      padding: `5px 30px`,
      alignItems: "center",
      background: `rgba(255, 255, 255, 0.9)`,
    },
  }
}
